INSERT INTO `film` VALUES (13,'Forrest Gump',8.462,'A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.','1994-06-23 00:00:00','en',23.7466,677387716,142,0,'2026-01-01 02:39:43'),(28,'Apocalypse Now',8.268,'At the height of the Vietnam war, Captain Benjamin Willard is sent on a dangerous mission that, officially, \"does not exist, nor will it ever exist.\" His goal is to locate - and eliminate - a mysterious Green Beret Colonel named Walter Kurtz, who has been leading his personal army on illegal guerrilla missions into enemy territory.','1979-05-19 00:00:00','en',8.7499,150000000,147,0,'2026-01-01 02:39:43'),(73,'American History X',8.330,'Derek Vineyard is paroled after serving 3 years in prison for killing two African-American men. Through his brother, Danny Vineyard\'s narration, we learn that before going to prison, Derek was a skinhead and the leader of a violent white supremacist gang that committed acts of racial crime throughout L.A. and his actions greatly influenced Danny. Reformed and fresh out of prison, Derek severs contact with the gang and becomes determined to keep Danny from going down the same violent path as he did.','1998-07-01 00:00:00','en',6.4958,23900000,119,0,'2026-01-01 02:39:43'),(101,'Léon: The Professional',8.299,'Léon, the top hit man in New York, has earned a rep as an effective \"cleaner\". But when his next-door neighbors are wiped out by a loose-cannon DEA agent, he becomes the unwilling custodian of 12-year-old Mathilda. Before long, Mathilda\'s thoughts turn to revenge, and she considers following in Léon\'s footsteps.','1994-09-14 00:00:00','fr',13.4734,45284974,111,0,'2026-01-01 02:39:43'),(105,'Back to the Future',8.322,'Eighties teenager Marty McFly is accidentally sent back in time to 1955, inadvertently disrupting his parents\' first meeting and attracting his mother\'s romantic interest. Marty must repair the damage to history by rekindling his parents\' romance and - with the help of his eccentric inventor friend Doc Brown - return to 1985.','1985-07-03 00:00:00','en',22.5549,381109762,116,0,'2026-01-01 02:39:43'),(120,'The Lord of the Rings: The Fellowship of the Ring',8.400,'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.','2001-12-18 00:00:00','en',30.0788,871368364,179,0,'2026-01-01 02:39:43'),(121,'The Lord of the Rings: The Two Towers',8.400,'Frodo Baggins and the other members of the Fellowship continue on their sacred quest to destroy the One Ring--but on separate paths. Their destinies lie at two towers--Orthanc Tower in Isengard, where the corrupt wizard Saruman awaits, and Sauron\'s fortress at Barad-dur, deep within the dark lands of Mordor. Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.','2002-12-18 00:00:00','en',25.9497,926287400,179,0,'2026-01-01 02:39:43'),(122,'The Lord of the Rings: The Return of the King',8.500,'As armies mass for a final battle that will decide the fate of the world--and powerful, ancient forces of Light and Dark compete to determine the outcome--one member of the Fellowship of the Ring is revealed as the noble heir to the throne of the Kings of Men. Yet, the sole hope for triumph over evil lies with a brave hobbit, Frodo, who, accompanied by his loyal friend Sam and the hideous, wretched Gollum, ventures deep into the very dark heart of Mordor on his seemingly impossible quest to destroy the Ring of Power.​','2003-12-17 00:00:00','en',25.2138,1118888979,201,0,'2026-01-01 02:39:43'),(128,'Princess Mononoke',8.300,'Ashitaka, a prince of the disappearing Emishi people, is cursed by a demonized boar god and must journey to the west to find a cure. Along the way, he encounters San, a young human woman fighting to protect the forest, and Lady Eboshi, who is trying to destroy it. Ashitaka must find a way to bring balance to this conflict.','1997-07-12 00:00:00','ja',9.6930,176506186,134,0,'2026-01-01 02:39:43'),(129,'Spirited Away',8.533,'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.','2001-07-20 00:00:00','ja',22.3099,274925095,125,0,'2026-01-01 02:39:43'),(155,'The Dark Knight',8.525,'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.','2008-07-16 00:00:00','en',25.8884,1004558444,152,0,'2026-01-01 02:39:43'),(207,'Dead Poets Society',8.302,'At an elite, old-fashioned boarding school in New England, a passionate English teacher inspires his students to rebel against convention and seize the potential of every day, courting the disdain of the stern headmaster.','1989-06-02 00:00:00','en',11.4741,235860116,129,0,'2026-01-01 02:39:43'),(238,'The Godfather',8.685,'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.','1972-03-14 00:00:00','en',31.9968,245066411,175,0,'2026-01-01 02:39:43'),(240,'The Godfather Part II',8.571,'In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.','1974-12-20 00:00:00','en',19.6821,102600000,202,0,'2026-01-01 02:39:43'),(274,'The Silence of the Lambs',8.300,'Clarice Starling is a top student at the FBI\'s training academy.  Jack Crawford wants Clarice to interview Dr. Hannibal Lecter, a brilliant psychiatrist who is also a violent psychopath, serving life behind bars for various acts of murder and cannibalism.  Crawford believes that Lecter may have insight into a case and that Starling, as an attractive young woman, may be just the bait to draw him out.','1991-02-14 00:00:00','en',3.3635,272742922,119,0,'2026-01-01 02:39:43'),(278,'The Shawshank Redemption',8.713,'Imprisoned in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.','1994-09-23 00:00:00','en',38.7714,28341469,142,0,'2026-01-01 02:39:43'),(311,'Once Upon a Time in America',8.396,'A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.','1984-05-23 00:00:00','en',10.8495,5500000,229,0,'2026-01-01 02:39:43'),(335,'Once Upon a Time in the West',8.300,'As the railroad builders advance unstoppably through the Arizona desert on their way to the sea, Jill arrives in the small town of Flagstone with the intention of starting a new life.','1968-12-21 00:00:00','it',9.1281,5380118,166,0,'2026-01-01 02:39:43'),(346,'Seven Samurai',8.452,'A samurai answers a village\'s request for protection after he falls on hard times. The town needs protection from bandits, so the samurai gathers six others to help him teach the people how to defend themselves, and the villagers provide the soldiers with food.','1954-04-26 00:00:00','ja',8.1144,105000000,207,0,'2026-01-01 02:39:43'),(389,'12 Angry Men',8.549,'The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young Spanish-American is guilty or innocent of murdering his father. What begins as an open and shut case soon becomes a mini-drama of each of the jurors\' prejudices and preconceptions about the trial, the accused, and each other.','1957-04-10 00:00:00','en',10.4551,4360000,97,0,'2026-01-01 02:39:43'),(423,'The Pianist',8.379,'The true story of pianist Władysław Szpilman\'s experiences in Warsaw during the Nazi occupation. When the Jews of the city find themselves forced into a ghetto, Szpilman finds work playing in a café; and when his family is deported in 1942, he stays behind, works for a while as a laborer, and eventually goes into hiding in the ruins of the war-torn city.','2002-09-17 00:00:00','en',9.7164,120098945,150,0,'2026-01-01 02:39:43'),(424,'Schindler\'s List',8.600,'The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.','1993-12-15 00:00:00','en',13.7007,321365567,195,0,'2026-01-01 02:39:43'),(429,'The Good, the Bad and the Ugly',8.466,'While the Civil War rages on between the Union and the Confederacy, three men – a quiet loner, a ruthless hitman, and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.','1966-12-22 00:00:00','it',12.9574,38900000,161,0,'2026-01-01 02:39:43'),(497,'The Green Mile',8.503,'A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people\'s ailments. When the cell block\'s head guard, Paul Edgecomb, recognizes Coffey\'s miraculous gift, he tries desperately to help stave off the condemned man\'s execution.','1999-12-10 00:00:00','en',21.3803,286801374,189,0,'2026-01-01 02:39:43'),(510,'One Flew Over the Cuckoo\'s Nest',8.412,'A petty criminal fakes insanity to serve his sentence in a mental ward rather than prison. He soon finds himself as a leader to the other patients—and an enemy to the cruel, domineering nurse who runs the ward.','1975-11-19 00:00:00','en',8.5619,108981275,133,0,'2026-01-01 02:39:43'),(539,'Psycho',8.421,'When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother.','1960-09-08 00:00:00','en',11.8090,50048065,109,0,'2026-01-01 02:39:43'),(550,'Fight Club',8.438,'A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground \"fight clubs\" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.','1999-10-15 00:00:00','en',29.5974,100853753,139,0,'2026-01-01 02:39:43'),(567,'Rear Window',8.300,'A wheelchair-bound photographer spies on his neighbors from his apartment window and becomes convinced one of them has committed murder.','1954-09-01 00:00:00','en',6.2502,37042336,112,0,'2026-01-01 02:39:43'),(598,'City of God',8.426,'In the poverty-stricken favelas of Rio de Janeiro in the 1970s, two young men choose different paths. Rocket is a budding photographer who documents the increasing drug-related violence of his neighborhood, while José “Zé” Pequeno is an ambitious drug dealer diving into a dangerous life of crime.','2002-08-30 00:00:00','pt',8.1396,30641770,129,0,'2026-01-01 02:39:43'),(599,'Sunset Boulevard',8.300,'A hack screenwriter writes a screenplay for a former silent film star who has faded into Hollywood obscurity.','1950-08-10 00:00:00','en',4.2629,5000000,110,0,'2026-01-01 02:39:43'),(603,'The Matrix',8.237,'Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.','1999-03-31 00:00:00','en',23.6479,463517383,136,0,'2026-01-01 02:39:43'),(637,'Life Is Beautiful',8.400,'A touching story of an Italian book seller of Jewish ancestry who lives in his own little fairy tale. His creative and happy life would come to an abrupt halt when his entire family is deported to a concentration camp during World War II. While locked up he tries to convince his son that the whole thing is just a game.','1997-12-20 00:00:00','it',7.3201,230098753,116,0,'2026-01-01 02:39:43'),(670,'Oldboy',8.244,'With no clue how he came to be imprisoned, drugged and tortured for 15 years, a desperate man seeks revenge on his captors.','2003-11-21 00:00:00','ko',12.3999,17500000,120,0,'2026-01-01 02:39:43'),(680,'Pulp Fiction',8.486,'A burger-loving hit man, his philosophical partner, a drug-addled gangster\'s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.','1994-09-10 00:00:00','en',22.3067,213928762,154,0,'2026-01-01 02:39:43'),(769,'GoodFellas',8.453,'The true story of Henry Hill, a half-Irish, half-Sicilian Brooklyn kid who is adopted by neighbourhood gangsters at an early age and climbs the ranks of a Mafia family under the guidance of Jimmy Conway.','1990-09-12 00:00:00','en',17.7570,47072327,145,0,'2026-01-01 02:39:43'),(807,'Se7en',8.378,'Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the \"seven deadly sins\" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Somerset researches each sin in an effort to get inside the killer\'s mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.','1995-09-22 00:00:00','en',19.2403,327311859,127,0,'2026-01-01 02:39:43'),(901,'City Lights',8.263,'A tramp falls in love with a beautiful blind flower girl. His on-and-off friendship with a wealthy man allows him to be the girl\'s benefactor and suitor.','1931-02-06 00:00:00','en',2.8376,4250000,87,0,'2026-01-01 02:39:43'),(914,'The Great Dictator',8.300,'Dictator Adenoid Hynkel tries to expand his empire while a poor Jewish barber tries to avoid persecution from Hynkel\'s regime.','1940-10-15 00:00:00','en',2.3043,11000000,125,0,'2026-01-01 02:39:43'),(975,'Paths of Glory',8.260,'A commanding officer defends three scapegoats on trial for a failed offensive that occurred within the French Army in 1916.','1957-10-25 00:00:00','en',5.4698,1200000,88,0,'2026-01-01 02:39:43'),(1585,'It\'s a Wonderful Life',8.276,'A holiday favourite for generations...  George Bailey has spent his entire life giving to the people of Bedford Falls.  All that prevents rich skinflint Mr. Potter from taking over the entire town is George\'s modest building and loan company.  But on Christmas Eve the business\'s $8,000 is lost and George\'s troubles begin.','1946-12-20 00:00:00','en',30.2649,9644124,130,0,'2026-01-01 02:39:43'),(1891,'The Empire Strikes Back',8.393,'The epic saga continues as Luke Skywalker, in hopes of defeating the evil Galactic Empire, learns the ways of the Jedi from aging master Yoda. But Darth Vader is more determined than ever to capture Luke. Meanwhile, rebel leader Princess Leia, cocky Han Solo, Chewbacca, and droids C-3PO and R2-D2 are thrown into various stages of capture, betrayal and despair.','1980-05-20 00:00:00','en',9.1554,538400000,124,0,'2026-01-01 02:39:43'),(3082,'Modern Times',8.284,'A bumbling tramp desires to build a home with a young woman, yet is thwarted time and time again by his lack of experience and habit of being in the wrong place at the wrong time..','1936-02-05 00:00:00','en',2.6670,1800000,87,0,'2026-01-01 02:39:43'),(3782,'Ikiru',8.317,'Kanji Watanabe is a middle-aged man who has worked in the same monotonous bureaucratic position for decades. Learning he has cancer, he starts to look for the meaning of his life.','1952-10-09 00:00:00','ja',3.7426,55240,143,0,'2026-01-01 02:39:43'),(4935,'Howl\'s Moving Castle',8.389,'Sophie, a young milliner, is turned into an elderly woman by a witch who enters her shop and curses her. She encounters a wizard named Howl and gets caught up in his resistance to fighting for the king.','2004-09-09 00:00:00','ja',14.1027,236049757,119,0,'2026-01-01 02:39:43'),(8587,'The Lion King',8.256,'Young lion prince Simba, eager to one day become king of the Pride Lands, grows up under the watchful eye of his father Mufasa; all the while his villainous uncle Scar conspires to take the throne for himself. Amid betrayal and tragedy, Simba must confront his past and find his rightful place in the Circle of Life.','1994-06-15 00:00:00','en',17.4023,763455561,89,0,'2026-01-01 02:39:43'),(10376,'The Legend of 1900',8.246,'The story of a virtuoso piano player who lives his entire life aboard an ocean liner. Born and raised on the ship, 1900 learned about the outside world through interactions with passengers, never setting foot on land, even for the love of his life. Years later, the ship may be destroyed, and a former band member fears that 1900 may still be aboard, willing to go down with the ship.','1998-10-28 00:00:00','it',3.8867,21057208,170,0,'2026-01-01 02:39:43'),(10494,'Perfect Blue',8.298,'Rising pop star Mima quits singing to pursue a career as an actress. After she takes up a role on a popular detective show, her handlers and collaborators begin turning up murdered. Harboring feelings of guilt and haunted by visions of her former self, Mima\'s reality and fantasy meld into a frenzied paranoia.','1998-02-28 00:00:00','ja',8.3200,683666,82,0,'2026-01-01 02:39:43'),(11216,'Cinema Paradiso',8.428,'A filmmaker recalls his childhood, when he fell in love with the movies at his village\'s theater and formed a deep friendship with the theater\'s projectionist.','1988-11-17 00:00:00','it',6.0629,12462062,124,0,'2026-01-01 02:39:43'),(12477,'Grave of the Fireflies',8.445,'In the final months of World War II, 14-year-old Seita and his sister Setsuko are orphaned when their mother is killed during an air raid in Kobe, Japan. After a falling out with their aunt, they move into an abandoned bomb shelter. With no surviving relatives and their emergency rations depleted, Seita and Setsuko struggle to survive.','1988-04-16 00:00:00','ja',0.0096,842132,89,0,'2026-01-01 02:39:43'),(12493,'High and Low',8.343,'A Yokohama shoe executive faces a wrenching choice when kidnappers mistakenly seize his chauffeur’s son but demand the ransom anyway.','1963-03-01 00:00:00','ja',3.8576,0,142,0,'2026-01-01 02:39:43'),(14537,'Harakiri',8.400,'Down-on-his-luck veteran Tsugumo Hanshirō enters the courtyard of the prosperous House of Iyi. Unemployed, and with no family, he hopes to find a place to commit seppuku—and a worthy second to deliver the coup de grâce in his suicide ritual. The senior counselor for the Iyi clan questions the ronin’s resolve and integrity, suspecting Hanshirō of seeking charity rather than an honorable end. What follows is a pair of interlocking stories which lay bare the difference between honor and respect, and promises to examine the legendary foundations of the Samurai code.','1962-09-15 00:00:00','ja',4.3909,0,135,0,'2026-01-01 02:39:43'),(15804,'A Brighter Summer Day',8.300,'A boy experiences first love, friendships and injustices growing up in 1960s Taiwan.','1991-07-27 00:00:00','zh',2.6429,0,237,0,'2026-01-01 02:39:43'),(18491,'Neon Genesis Evangelion: The End of Evangelion',8.300,'SEELE orders an all-out attack on NERV, aiming to destroy the Evas before Gendo can advance his own plans for the Human Instrumentality Project. Shinji is pushed to the limits of his sanity as he is forced to decide the fate of humanity.','1997-07-19 00:00:00','ja',7.7779,20563523,87,0,'2026-01-01 02:39:43'),(19404,'Dilwale Dulhania Le Jayenge',8.515,'Raj is a rich, carefree, happy-go-lucky second generation NRI. Simran is the daughter of Chaudhary Baldev Singh, who in spite of being an NRI is very strict about adherence to Indian values. Simran has left for India to be married to her childhood fiancé. Raj leaves for India with a mission at his hands, to claim his lady love under the noses of her whole family. Thus begins a saga.','1995-10-20 00:00:00','hi',7.4532,100000000,190,0,'2026-01-01 02:39:43'),(24188,'Il Sorpasso',8.223,'Roberto, a shy law student in Rome, meets Bruno, a forty-year-old exuberant, capricious man, who takes him for a drive through the Roman and Tuscany countries in the summer. When their journey starts to blend into their daily lives though, the pair’s newfound friendship is tested.','1962-12-05 00:00:00','it',4.3411,0,105,0,'2026-01-01 02:39:43'),(27205,'Inception',8.371,'Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person\'s idea into a target\'s subconscious.','2010-07-15 00:00:00','en',31.7759,839030630,148,0,'2026-01-01 02:39:43'),(29259,'Le Trou',8.239,'Four prison inmates have been hatching a plan to literally dig out of jail when another prisoner, Claude Gaspard, is moved into their cell. They take a risk and share their plan with the newcomer. Over the course of three days, the prisoners and friends break through the concrete floor using a bed post and begin to make their way through the sewer system – yet their escape is anything but assured.','1960-03-18 00:00:00','fr',2.4011,33187,132,0,'2026-01-01 02:39:43'),(40096,'A Dog\'s Will',8.400,'The lively João Grilo and the sly Chicó are poor guys living in the hinterland who cheat a bunch of people in a small town in Northeastern Brazil. When they die, they have to be judged by Christ, the Devil and the Virgin Mary before they are admitted to paradise.','2000-09-15 00:00:00','pt',1.5130,4903192,104,0,'2026-01-01 02:39:43'),(42269,'We All Loved Each Other So Much',8.285,'Three partisans bound by a strong friendship return home after the war, but the clash with everyday reality puts a strain on their bond.','1974-12-21 00:00:00','it',1.1643,0,125,0,'2026-01-01 02:39:43'),(77338,'The Intouchables',8.271,'A true story of two men who should never have met – a quadriplegic aristocrat who was injured in a paragliding accident and a young man from the projects.','2011-11-02 00:00:00','fr',13.6911,426590315,113,0,'2026-01-01 02:39:43'),(92060,'Michael Jackson\'s Thriller',8.221,'A night at the movies turns terrifying when Michael and his date are attacked by zombies. Released at the height of Thriller’s success, the short film redefined the music video, broke racial barriers, and became the first inducted into the U.S. National Film Registry.','1983-11-14 00:00:00','en',3.1057,0,14,0,'2026-01-01 02:39:43'),(92321,'Hotarubi no Mori e',8.267,'One hot summer day a little girl gets lost in an enchanted forest of the mountain god where spirits reside. A young boy appears before her, but she cannot touch him for fear of making him disappear. And so a wondrous adventure awaits...','2011-09-17 00:00:00','ja',0.0042,0,45,0,'2026-01-01 02:39:43'),(157336,'Interstellar',8.465,'The adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.','2014-11-05 00:00:00','en',42.3058,746606706,169,0,'2026-01-01 02:39:43'),(244786,'Whiplash',8.376,'Under the direction of a ruthless instructor, a talented young drummer begins to pursue perfection at any cost, even his humanity.','2014-10-10 00:00:00','en',14.7685,50307484,107,0,'2026-01-01 02:39:43'),(255709,'Hope',8.397,'After 8-year-old So-won narrowly survives a brutal sexual assault, her family labors to help her heal while coping with their own rage and grief.','2013-10-02 00:00:00','ko',3.5005,0,122,0,'2026-01-01 02:39:43'),(299534,'Avengers: Endgame',8.238,'After the devastating events of Avengers: Infinity War, the universe is in ruins due to the efforts of the Mad Titan, Thanos. With the help of remaining allies, the Avengers must assemble once more in order to undo Thanos\' actions and restore order to the universe once and for all, no matter what consequences may be in store.','2019-04-24 00:00:00','en',25.3178,2799439100,181,0,'2026-01-01 02:39:43'),(299536,'Avengers: Infinity War',8.235,'As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.','2018-04-25 00:00:00','en',31.1084,2052415039,149,0,'2026-01-01 02:39:43'),(324857,'Spider-Man: Into the Spider-Verse',8.400,'Struggling to find his place in the world while juggling school and family, Brooklyn teenager Miles Morales is unexpectedly bitten by a radioactive spider and develops unfathomable powers just like the one and only Spider-Man. While wrestling with the implications of his new abilities, Miles discovers a super collider created by the madman Wilson \"Kingpin\" Fisk, causing others from across the Spider-Verse to be inadvertently transported to his dimension.','2018-12-06 00:00:00','en',17.5039,393602435,117,0,'2026-01-01 02:39:43'),(372058,'Your Name.',8.500,'High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.','2016-08-26 00:00:00','ja',21.0932,358000000,106,0,'2026-01-01 02:39:43'),(372754,'Dou kyu sei – Classmates',8.300,'Rihito Sajo, an honor student with a perfect score on the entrance exam and Hikaru Kusakabe, in a band and popular among girls, would have never crossed paths. Until one day they started talking at the practice for their school’s upcoming chorus festival. After school, the two meet regularly, as Hikaru helps Rihito to improve his singing skills. While they listen to each other’s voice and harmonize, their hearts start to beat together.','2016-02-20 00:00:00','ja',1.4836,1397526,61,0,'2026-01-01 02:39:43'),(378064,'A Silent Voice: The Movie',8.385,'Shouya Ishida starts bullying the new girl in class, Shouko Nishimiya, because she is deaf. But as the teasing continues, the rest of the class starts to turn on Shouya for his lack of compassion. When they leave elementary school, Shouko and Shouya do not speak to each other again... until an older, wiser Shouya, tormented by his past behaviour, decides he must see Shouko once more. He wants to atone for his sins, but is it already too late...?','2016-09-17 00:00:00','ja',8.4982,30819442,129,0,'2026-01-01 02:39:43'),(447362,'Life in a Year',8.240,'A 17 year old finds out that his girlfriend is dying, so he sets out to give her an entire life, in the last year she has left.','2020-11-27 00:00:00','en',3.4084,0,107,0,'2026-01-01 02:39:43'),(490132,'Green Book',8.224,'Tony Lip, a bouncer in 1962, is hired to drive pianist Don Shirley on a tour through the Deep South in the days when African Americans, forced to find alternate accommodations and services due to segregation laws below the Mason-Dixon Line, relied on a guide called The Negro Motorist Green Book.','2018-11-16 00:00:00','en',13.7926,321752656,130,0,'2026-01-01 02:39:43'),(496243,'Parasite',8.495,'All unemployed, Ki-taek\'s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.','2019-05-30 00:00:00','ko',22.3934,257591776,133,0,'2026-01-01 02:39:43'),(504253,'I Want to Eat Your Pancreas',8.200,'After his classmate and crush is diagnosed with a pancreatic disease, an average high schooler sets out to make the most of her final days.','2018-09-01 00:00:00','ja',5.6934,33748006,108,0,'2026-01-01 02:39:43'),(508965,'Klaus',8.228,'A selfish postman and a reclusive toymaker form an unlikely friendship, delivering joy to a cold, dark town that desperately needs it.','2019-11-08 00:00:00','en',17.9139,0,97,0,'2026-01-01 02:39:43'),(527641,'Five Feet Apart',8.222,'Seventeen-year-old Stella spends most of her time in the hospital as a cystic fibrosis patient. Her life is full of routines, boundaries and self-control — all of which get put to the test when she meets Will, an impossibly charming teen who has the same illness. There\'s an instant flirtation, though restrictions dictate that they must maintain a safe distance between them. As their connection intensifies, so does the temptation to throw the rules out the window and embrace that attraction.','2019-03-14 00:00:00','en',5.7029,92600000,116,0,'2026-01-01 02:39:43'),(533514,'Violet Evergarden: The Movie',8.294,'As the world moves on from the war and technological advances bring changes to her life, Violet still hopes to see her lost commanding officer again.','2020-09-18 00:00:00','ja',3.3802,20339624,140,0,'2026-01-01 02:39:43'),(568332,'Taylor Swift: Reputation Stadium Tour',8.233,'Taylor Swift takes the stage in Dallas for the Reputation Stadium Tour and celebrates a monumental night of music, memories and visual magic.','2018-12-31 00:00:00','en',0.9398,0,125,0,'2026-01-01 02:39:43'),(569094,'Spider-Man: Across the Spider-Verse',8.300,'After reuniting with Gwen Stacy, Brooklyn’s full-time, friendly neighborhood Spider-Man is catapulted across the Multiverse, where he encounters the Spider Society, a team of Spider-People charged with protecting the Multiverse\'s very existence. But when the heroes clash on how to handle a new threat, Miles finds himself pitted against the other Spiders and must set out on his own to save those he loves most.','2023-05-31 00:00:00','en',27.8552,690897910,140,0,'2026-01-01 02:39:43'),(572154,'Rascal Does Not Dream of a Dreaming Girl',8.245,'In Fujisawa, Sakuta Azusagawa is in his second year of high school. Blissful days with his girlfriend and upperclassman, Mai Sakurajima, are interrupted by the appearance of his first crush, Shoko Makinohara.','2019-06-15 00:00:00','ja',2.3020,0,90,0,'2026-01-01 02:39:43'),(620249,'The Legend of Hei',8.319,'When cat spirit Luo Xiaohei\'s home is deforested by humans, he must find a new one. He runs into a group of other spirit creatures who take him under their wing with dreams of reconquering the land they say is rightfully theirs. However, they run into a human known as Wuxian who separates Luo Xiaohei from the other spirits and the two go on a journey, with the cat spirit learning to control his abilities as well as forming his own thoughts on whether or not he should ally with the spirits or the humans.','2019-08-27 00:00:00','zh',5.3139,48045728,102,0,'2026-01-01 02:39:43'),(630566,'Clouds',8.200,'Young musician Zach Sobiech discovers his cancer has spread, leaving him just a few months to live. With limited time, he follows his dream and makes an album, unaware that it will soon be a viral music phenomenon.','2020-10-09 00:00:00','en',3.0868,0,121,0,'2026-01-01 02:39:43'),(632632,'Given',8.300,'Haruki secretly had feelings for Akihiko for years, but Akihiko was still in a relationship with his roommate, the violinist Ugetsu Murata. Haruki, Akihiko, and Ugetsu\'s love clashes and starts to move forward.','2020-08-22 00:00:00','ja',2.0925,930363,60,0,'2026-01-01 02:39:43'),(637920,'Miracle in Cell No. 7',8.255,'Separated from his daughter, a father with an intellectual disability must prove his innocence when he is jailed for the death of a commander\'s child.','2019-10-10 00:00:00','tr',6.6429,28000000,132,0,'2026-01-01 02:39:43'),(644479,'Dedicated to my ex',8.300,'The film tells the story of Ariel, a 21-year-old who decides to form a rock band to compete for a prize of ten thousand dollars in a musical band contest, this as a last option when trying to get money to save their relationship and reunite with his ex-girlfriend, which breaks due to the trip she must make to Finland for an internship. Ariel with her friend Ortega, decides to make a casting to find the other members of the band, although they do not know nothing about music, thus forming a band with members that have diverse and opposite personalities.','2019-11-01 00:00:00','es',0.5842,1315376,94,0,'2026-01-01 02:39:43'),(652837,'Josee, the Tiger and the Fish',8.292,'With dreams of diving abroad, Tsuneo gets a job assisting Josee, an artist whose imagination takes her far beyond her wheelchair. But when the tide turns against them, they push each other to places they never thought possible, and inspire a love fit for a storybook.','2020-12-25 00:00:00','ja',2.7158,0,98,0,'2026-01-01 02:39:43'),(654299,'Out of the Clear Blue Sky',8.242,'Returning to Earth as an imitator, the legendary Mexican artist Pedro Infante must prove that he is no longer a womanizer to enter paradise.','2019-12-24 00:00:00','es',0.7084,0,112,0,'2026-01-01 02:39:43'),(667257,'Impossible Things',8.425,'After the death of her abusive husband, Matilde finds her new best friend in Miguel, her young, insecure, and disoriented neighbor.','2021-06-17 00:00:00','es',5.7577,0,88,0,'2026-01-01 02:39:43'),(696374,'Gabriel\'s Inferno',8.400,'An intriguing and sinful exploration of seduction, forbidden love, and redemption, Gabriel\'s Inferno is a captivating and wildly passionate tale of one man\'s escape from his own personal hell as he tries to earn the impossible--forgiveness and love.','2020-05-29 00:00:00','en',3.9748,0,122,0,'2026-01-01 02:39:43'),(724089,'Gabriel\'s Inferno: Part II',8.400,'Professor Gabriel Emerson finally learns the truth about Julia Mitchell\'s identity, but his realization comes a moment too late. Julia is done waiting for the well-respected Dante specialist to remember her and wants nothing more to do with him. Can Gabriel win back her heart before she finds love in another\'s arms?','2020-07-31 00:00:00','en',1.4339,0,106,0,'2026-01-01 02:39:43'),(761053,'Gabriel\'s Inferno: Part III',8.400,'The final part of the film adaption of the erotic romance novel Gabriel\'s Inferno written by an anonymous Canadian author under the pen name Sylvain Reynard.','2020-11-19 00:00:00','en',3.1690,0,102,0,'2026-01-01 02:39:43'),(770156,'Lucy Shimmers and the Prince of Peace',8.370,'Second chances start when a hardened criminal crosses paths with a precocious little girl who is helped by an angel to change hearts during the holiday season.','2020-10-19 00:00:00','en',3.0966,0,87,0,'2026-01-01 02:39:43'),(820067,'The Quintessential Quintuplets Movie',8.322,'When five lovely young girls who hate studying hire part-time tutor Futaro, he guides not only their education but also their hearts. Time spent has brought them all closer, with feelings growing within the girls and Futaro. As they finish their third year of high school and their last school festival approaches, they set their sights on what’s next. Is there a future with one of them and Futaro?','2022-05-20 00:00:00','ja',2.6800,17288993,136,0,'2026-01-01 02:39:43'),(1058694,'Radical',8.400,'In a Mexican border town plagued by neglect, corruption, and violence, a frustrated teacher tries an unorthodox new method to break through his students’ apathy and unlock their curiosity, their potential... and perhaps even their genius.','2023-10-19 00:00:00','es',1.6337,21761164,126,0,'2026-01-01 02:39:43'),(1139087,'Once Upon a Studio',8.300,'Created for Disney\'s 100th anniversary, the short features Mickey Mouse corralling a gallery of legendary Disney characters for a group photo.','2023-09-24 00:00:00','en',3.1069,0,9,0,'2026-01-01 02:39:43'),(1184918,'The Wild Robot',8.300,'After a shipwreck, an intelligent robot called Roz is stranded on an uninhabited island. To survive the harsh environment, Roz bonds with the island\'s animals and cares for an orphaned baby goose.','2024-09-12 00:00:00','en',20.3238,331982078,102,0,'2026-01-01 02:39:43'),(1186532,'The Forge',8.268,'19 year old Isaiah Wright lives for basketball and video games. A year out of high school, he has no job, no plans, and no idea how to be a man. At odds with his single mother Cynthia, Isaiah is given an ultimatum – to step up or move out. Feeling the pull from his friends and the push from his mom, Isaiah is hired by Moore Fitness, unaware of how the owner will personally impact his life. With the prayers of his mother and unexpected guidance from his new mentor, Isaiah is forced to deal with his past, sacrifice his selfishness and discover how God might have a greater purpose for his life.','2024-08-22 00:00:00','en',5.1531,40392664,123,0,'2026-01-01 02:39:43'),(1218925,'Chainsaw Man - The Movie: Reze Arc',8.282,'In a brutal war between devils, hunters, and secret enemies, a mysterious girl named Reze has stepped into Denji\'s world, and he faces his deadliest battle yet, fueled by love in a world where survival knows no rules.','2025-09-19 00:00:00','ja',82.7733,10000000,100,0,'2026-01-01 02:39:43'),(1356039,'Counterattack',8.277,'When a hostage rescue mission creates a new enemy, Capt. Guerrero and his elite soldiers must face an ambush by a criminal group.','2025-02-27 00:00:00','es',9.6118,0,85,0,'2026-01-01 02:39:43');
